import React, { useEffect } from "react";

async function fetchBeatProducerData() {
  const res = await fetch("http://localhost:5000/beatProducer");
  const data = await res.json();
  fetchArtistData(data);
}

useEffect(() => {
  try {
    fetchArtistData(match.props.rapper);
  } catch (error) {}
});
const Rapper = ({ match }) => {
  return (
    <div className="container">
      <div className="row">
        <div className="col-2">image box</div>
        <div className="col-10">
          <div>name box</div>
          <div>About box</div>
        </div>
      </div>
      <div className="row">
        <div className="col-8">SOngs famous</div>
        <div className="col-4">social links</div>
      </div>
    </div>
  );
};
export default Rapper;
